import {GoogleCharts} from 'google-charts'

export default function EnergyPieChart(props) {


    GoogleCharts.load(drawChart);

    // Draw the chart and set the chart values
    function drawChart() {
    var data = GoogleCharts.api.visualization.arrayToDataTable([
    ['Energy%', 'näringsämne'],
    ['Proiten', props.energyNutrients['Protein']*4],
    ['Kolhydrater', props.energyNutrients['Kolhydrater']*4],
    ['Fett', props.energyNutrients['Kolhydrater']*9]
    ]);

    // Optional; add a title and set the width and height of the chart
    var options = {'title':'My Average Day', 'width':550, 'height':400};

    // Display the chart inside the <div> element with id="piechart"
    var piechart = new GoogleCharts.api.visualization.PieChart(document.getElementById('piechart'));
    piechart.draw(data, options);
    }

    return (
        <div>
            <h2> Energi% per näringsämne </h2>
            <div id="piechart"></div>
        </div>
    )
}
